selector_to_html = {"a[href=\"wireless.html#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Emparejamiento One-to-One<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidad media<a class=\"headerlink\" href=\"#medium-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#prefix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Prefijo<a class=\"headerlink\" href=\"#prefix\" title=\"Link to this heading\">#</a></h2><h3>A\u00f1adir prefijo<a class=\"headerlink\" href=\"#add-prefix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n del Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de trabajo<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>En el \u00e1rea de trabajo fuera del rango de los 2. G receptor o se\u00f1al Bluetooth, puede activar el modo de almacenamiento del esc\u00e1ner siguiendo los pasos descritos a continuaci\u00f3n. En este modo, todos los datos escaneados ser\u00e1n almacenados directamente en el esc\u00e1ner. Antes de subir los datos se guardar\u00e1 permanentemente en el esc\u00e1ner para que puedas subir los datos cuando el esc\u00e1ner est\u00e9 en el rango de se\u00f1al que recibe.</p>", "a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Informaci\u00f3n de la bater\u00eda<a class=\"headerlink\" href=\"#battery-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Editando datos<a class=\"headerlink\" href=\"#data-editing\" title=\"Link to this heading\">#</a></h1><h2>Formato de salida<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Para cambiar el formato de transmisi\u00f3n de datos de escaneo, escanee uno de los ocho c\u00f3digos de barras correspondientes al formato deseado.</p>", "a[href=\"#wx-rf-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Gu\u00eda de configuraci\u00f3n r\u00e1pida del esc\u00e1ner inal\u00e1mbrico <strong>WX-RF</strong><a class=\"headerlink\" href=\"#wx-rf-wireless-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Obtener versi\u00f3n de Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Idioma del teclado<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Obtener idioma actual del teclado<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pregunta 3:El esc\u00e1ner escanea con \u00e9xito tres veces y no sube datos. \u00bfC\u00f3mo puedo resolver este problema?<a class=\"headerlink\" href=\"#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong></p>", "a[href=\"faq.html#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pregunta 1: El escaneo es exitoso, el zumbido suena una vez, pero no se cargan datos?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong> El esc\u00e1ner ha entrado en modo de almacenamiento y necesita escanear <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Modo Normal</span></a> para recuperar.</p>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tiempo de sue\u00f1o<a class=\"headerlink\" href=\"#sleep-time\" title=\"Link to this heading\">#</a></h2><p>Escaneando el siguiente c\u00f3digo de configuraci\u00f3n, puede establecer el esc\u00e1ner para entrar en modo de sue\u00f1o despu\u00e9s de un cierto per\u00edodo de tiempo en el que no se escanea ning\u00fan c\u00f3digo, para reducir el consumo de energ\u00eda.</p>", "a[href=\"faq.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">FAQ<a class=\"headerlink\" href=\"#faq\" title=\"Link to this heading\">#</a></h1><h2>Pregunta 1: El escaneo es exitoso, el zumbido suena una vez, pero no se cargan datos?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong> El esc\u00e1ner ha entrado en modo de almacenamiento y necesita escanear <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Modo Normal</span></a> para recuperar.</p>", "a[href=\"faq.html#question-5-scan-successful-uploaded-data-incorrect\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pregunta 5:\u00bfEscanear con \u00e9xito, los datos subidos son incorrectos?<a class=\"headerlink\" href=\"#question-5-scan-successful-uploaded-data-incorrect\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong></p>", "a[href=\"process.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Formato de salida<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Para cambiar el formato de transmisi\u00f3n de datos de escaneo, escanee uno de los ocho c\u00f3digos de barras correspondientes al formato deseado.</p>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes de volumen<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Escanea el c\u00f3digo de configuraci\u00f3n correspondiente para activar o desactivar el indicador de sonido del esc\u00e1ner</p>", "a[href=\"faq.html#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pregunta 4:El esc\u00e1ner muestra cinco veces cuando se presiona un bot\u00f3n. \u00bfC\u00f3mo puedo resolver este problema?<a class=\"headerlink\" href=\"#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong> La bater\u00eda es baja y necesita ser cargada antes de poder volver a usarla.</p>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de almacenamiento<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Carga de datos<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wired.html#automatic-selection-of-wired-wireless-transmission\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Selecci\u00f3n autom\u00e1tica de transmisi\u00f3n por cable/inal\u00e1mbrico<a class=\"headerlink\" href=\"#automatic-selection-of-wired-wireless-transmission\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#hide-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ocultar Set<a class=\"headerlink\" href=\"#hide-set\" title=\"Link to this heading\">#</a></h2><h3>Ocultar caracteres de inicio de c\u00f3digo de barras<a class=\"headerlink\" href=\"#hide-barcode-start-chars\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#appendix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ap\u00e9ndice<a class=\"headerlink\" href=\"#appendix\" title=\"Link to this heading\">#</a></h2><h3>C\u00f3digos num\u00e9ricos<a class=\"headerlink\" href=\"#numeric-bar-codes\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del teclado<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Configuraci\u00f3n del Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wired.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de cable<a class=\"headerlink\" href=\"#wired-mode\" title=\"Link to this heading\">#</a></h1><h2>Modo de transmisi\u00f3n<a class=\"headerlink\" href=\"#transmission-mode\" title=\"Link to this heading\">#</a></h2><h3>Cable USB como teclado<a class=\"headerlink\" href=\"#usb-cable-as-keyboard\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>", "a[href=\"wireless.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo inal\u00e1mbrico<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Link to this heading\">#</a></h1><p>Este modo utiliza la 2. Banda de frecuencia GHz para transmisi\u00f3n de datos y depende de la tecnolog\u00eda de radio frecuencia (RF) que se conecta al ordenador a trav\u00e9s de un receptor USB y permite al esc\u00e1ner moverse libremente a cierta distancia.</p>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo normal<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"faq.html#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pregunta 2:El esc\u00e1ner escanea con \u00e9xito, pega dos veces, y puede subir datos normalmente. \u00bfQu\u00e9 est\u00e1 pasando?<a class=\"headerlink\" href=\"#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\" title=\"Link to this heading\">#</a></h2><p><strong>Respuesta:</strong> La bater\u00eda de la pistola del esc\u00e1ner es baja y le indica que necesita ser recargada.</p>", "a[href=\"wireless.html#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidad baja<a class=\"headerlink\" href=\"#low-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#suffix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Suffix<a class=\"headerlink\" href=\"#suffix\" title=\"Link to this heading\">#</a></h2><h3>A\u00f1adir Sufijo<a class=\"headerlink\" href=\"#add-suffix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#quick-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuraci\u00f3n r\u00e1pida<a class=\"headerlink\" href=\"#quick-setup\" title=\"Link to this heading\">#</a></h2><h3>A\u00f1adir prefijo<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wired.html#transmission-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de transmisi\u00f3n<a class=\"headerlink\" href=\"#transmission-mode\" title=\"Link to this heading\">#</a></h2><h3>Cable USB como teclado<a class=\"headerlink\" href=\"#usb-cable-as-keyboard\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidad de transmisi\u00f3n del Teclado de Receptor <a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wired.html#usb-keyboard-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidad del teclado USB<a class=\"headerlink\" href=\"#usb-keyboard-speed\" title=\"Link to this heading\">#</a></h2><h3>Velocidad del teclado<a class=\"headerlink\" href=\"#get-keyboard-speed\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wired.html#usb-hid-multi-key-send-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Conjunto de env\u00edo de llaves m\u00faltiples HID USB<a class=\"headerlink\" href=\"#usb-hid-multi-key-send-set\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Alta velocidad<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ajustes del sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restaurar ajustes por defecto<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Cuando ocurre un error desconocido en el esc\u00e1ner, puede reiniciar el esc\u00e1ner restaurando la configuraci\u00f3n predeterminada.</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
